import logo from '../resources/apex_logo.svg';
import '../App.css';
import ReactMarkdown from 'react-markdown';
import remarkGfm from 'remark-gfm';

function MainContent(props) {

    const home = () => {
        return (
            <div>
                <img src={logo} alt="ApexBots" onClick={() => props.clickEvent("Home")}/>

                <h1 className="App-header-separator">ApexBots</h1>
            </div>
        )
    }

    const md = (md) => {
        return (
            <div className="markdown">
            <ReactMarkdown children={md} remarkPlugins={[remarkGfm]} />
            </div>
        )
    }

    const render = () => {
        return props.selectedBot === "Home" ? home() : md(props.md);
    }

    return (
        {render}
    );
}

export default MainContent;
